css:
.editor-colors {
  background-color: #272828;
  color: #e0e8e8;
}
.editor {
  font-weight: normal;
}
.editor.react .gutter .line-number .icon-right {
  padding-left: 4px;
  padding-right: 2px;
}
.editor .invisible-character {
  color: #3b3d3d;
}
.editor .indent-guide {
  color: #3b3d3d;
}
.editor .wrap-guide {
  background-color: #313232;
}
.editor .gutter {
  background-color: #2d2e2e;
  color: #747464;
}
.editor .gutter .cursor-line {
  background-color: #42423e;
  color: #e0e8e8;
}
.editor .line-number.cursor-line-no-selection {
  background-color: #42423e;
}
.editor .invisible {
  color: #e0e8e8;
}
.editor .cursor {
  border-color: #e0e8e8;
}
.editor .selection .region {
  background-color: #42423e;
}
.editor .search-results .marker .region {
  background-color: transparent;
  border: 1px solid #42423e;
}
.editor .search-results .marker.current-result .region {
  border: 1px solid #e0e8e8;
}
.editor .comment {
  color: #747464;
}
.editor .string {
  color: #ddd07b;
}
.editor .constant.numeric {
  color: #a98dff;
}
.editor .constant.language {
  color: #a98dff;
}
.editor .constant.character,
.editor .constant.other {
  color: #a98dff;
}
.editor .keyword {
  color: #ff255b;
}
.editor .storage {
  color: #ff255b;
}
.editor .storage.type {
  font-style: italic;
  color: #45d9df;
}
.editor .entity.name.class {
  text-decoration: underline;
  color: #a8d745;
}
.editor .entity.other.inherited-class {
  font-style: italic;
  text-decoration: underline;
  color: #a8d745;
}
.editor .entity.name.function {
  color: #a8d745;
}
.editor .entity.name.instance {
  color: #45d9df;
}
.editor .variable.other {
  color: #ffad55;
}
.editor .variable.parameter {
  font-style: italic;
  color: #ffad55;
}
.editor .entity.name.tag {
  color: #ff255b;
}
.editor .entity.other.attribute-name {
  color: #a8d745;
}
.editor .support.function {
  color: #45d9df;
}
.editor .support.constant {
  color: #45d9df;
}
.editor .support.type,
.editor .support.class {
  font-style: italic;
  color: #45d9df;
}
.editor .invalid {
  color: #e0e8e8;
  background-color: #ff255b;
}
.editor .invalid.deprecated {
  color: #e0e8e8;
  background-color: #a98dff;
}
.editor .class.jade {
  color: #a98dff;
}
.editor .gfm .markup.heading {
  color: #a8d745;
  font-weight: bold;
}
.editor .gfm .markup.underline {
  color: #ddd07b;
  text-decoration: underline;
}
.editor .gfm .bold {
  font-weight: bold;
}
.editor .gfm .italic {
  font-style: italic;
}
.editor .gfm .raw {
  color: #45d9df;
}
.editor .gfm .variable.list {
  color: #ff255b;
  font-weight: bold;
}
.editor .gfm .link {
  color: #b0b6b6;
}
.editor .gfm .link .entity {
  color: #a98dff;
}
